import React from 'react';
import PropTypes from 'prop-types';
import './css/friends.css';

const Friends = () => {
    return (
        <div>
            <section>
               <p>Amigos {}</p>
               <p>Nitro X</p>
               <p>Mensagem Direta +</p>
               <div>
                   <div></div>
                   <p>Nome</p>
               </div>
            </section>
        </div>
    )
}

Friends.defaultProps = {
    imagem1: 'X',
}

Friends.propTypes = {
    imagem1: PropTypes.string
}
export default Friends;
